  return (
    <>
      <TestBtn onClick={handleView}>ViewControl</TestBtn>
      {hanpy ? <span>국·반찬·메인요리 {children} </span> : <></>}
    </>
  );
};

export default ViewContent;

export const TestBtn = styled.button`
  & ul {
